    <div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x2 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">SWFTEA<span class="ff2 fc1"> <span class="fc2">Privacy Policy </span></span></div><div class="t m0 x2 h3 y3 ff2 fs0 fc3 sc0 ls0 ws0"> </div><div class="t m0 x2 h4 y4 ff1 fs1 fc4 sc0 ls0 ws0">1.Introduction </div><div class="t m0 x2 h5 y5 ff2 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>e believe your <span class="_ _1"></span>privacy is important.  </div><div class="t m0 x2 h5 y6 ff2 fs2 fc4 sc0 ls0 ws0">To fulfill our commitment to respecting and protecting your privacy, w<span class="_ _1"></span>e will adhere to the following principles:<span class="_ _0"></span> </div><div class="t m0 x3 h5 y7 ff2 fs2 fc4 sc0 ls1 ws0">1.<span class="ls0"> <span class="_ _2"> </span>W<span class="_ _0"></span>e will be informi<span class="_ _1"></span>ng you of the personal information that w<span class="_ _1"></span>ill be stored, and where appropriate seek your </span></div><div class="t m0 x4 h5 y8 ff2 fs2 fc4 sc0 ls0 ws0">consent to store, process, use, or disclose your personal infor<span class="_ _1"></span>mation.<span class="_ _0"></span> </div><div class="t m0 x3 h5 y9 ff2 fs2 fc4 sc0 ls1 ws0">2.<span class="ls0"> <span class="_ _2"> </span>W<span class="_ _0"></span>e will identify<span class="_ _1"></span> the purposes for which we w<span class="_ _1"></span>ill collect and further process you<span class="_ _0"></span>r pe<span class="_ _0"></span>rsonal information. </span></div><div class="t m0 x3 h5 ya ff2 fs2 fc4 sc0 ls1 ws0">3.<span class="ls0"> <span class="_ _2"> </span>W<span class="_ _0"></span>e will only<span class="_ _1"></span> collect information that is necessary to carry out the identified pur<span class="_ _1"></span>poses of use.<span class="_ _0"></span> </span></div><div class="t m0 x3 h5 yb ff2 fs2 fc4 sc0 ls1 ws0">4.<span class="ls0"> <span class="_ _2"> </span>W<span class="_ _0"></span>e will use or <span class="_ _1"></span>disclose your personal information only for the purposes for w<span class="_ _1"></span>hich it has been collected, </span></div><div class="t m0 x4 h5 yc ff2 fs2 fc4 sc0 ls0 ws0">except with your consent, or as required or permitted by applicable law, and we w<span class="_ _1"></span>ill retain your information </div><div class="t m0 x4 h5 yd ff2 fs2 fc4 sc0 ls0 ws0">only as long as necessary to fulfill those purposes. </div><div class="t m0 x3 h5 ye ff2 fs2 fc4 sc0 ls1 ws0">5.<span class="ls0"> <span class="_ _2"> </span>You will have access to your personal information and will be able to correct your <span class="_ _1"></span>personal information as </span></div><div class="t m0 x4 h5 yf ff2 fs2 fc4 sc0 ls0 ws0">appropriate in accordance with your rights under applicable law. </div><div class="t m0 x3 h5 y10 ff2 fs2 fc4 sc0 ls1 ws0">6.<span class="ls0"> <span class="_ _2"> </span>W<span class="_ _0"></span>e will be ac<span class="_ _1"></span>countable to you.  <span class="_ _1"></span>W<span class="_ _0"></span>e are interested in hearing your opinion regarding our compliance w<span class="_ _1"></span>ith </span></div><div class="t m0 x4 h5 y11 ff2 fs2 fc4 sc0 ls0 ws0">these principles, this Privacy Policy, and applicable laws. </div><div class="t m0 x2 h5 y12 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h4 y13 ff1 fs1 fc4 sc0 ls0 ws0">2.Scope of Th<span class="_ _1"></span>is Privacy<span class="_ _1"></span> Policy<span class="_ _1"></span> <span class="_ _0"></span> </div><div class="t m0 x2 h5 y14 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y15 ff1 fs2 fc4 sc0 ls0 ws0">2.a) Purpose of This Privacy Policy </div><div class="t m0 x2 h5 y16 ff2 fs2 fc4 sc0 ls0 ws0">This Privacy Policy explains how S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA will process and safeguard your personal information, and the rights and </div><div class="t m0 x2 h5 y17 ff2 fs2 fc4 sc0 ls0 ws0">choices you have with respect to your personal information.  <span class="_ _1"></span>This Privacy Policy applies to: personal information yo<span class="_ _0"></span><span class="ls1">u </span></div><div class="t m0 x2 h5 y18 ff2 fs2 fc4 sc0 ls0 ws0">provide us when you use the S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA communication app, and other apps that integrate w<span class="_ _1"></span>ith or work in conjunction </div><div class="t m0 x2 h7 y19 ff3 fs2 fc4 sc0 ls0 ws0">with the SWFTEA app (collectively Apps); personal information we collect w<span class="_ _1"></span>hen you visit websites maintained by us </div><div class="t m0 x2 h7 y1a ff3 fs2 fc4 sc0 ls0 ws0">relating to our Apps (Websites.  Apps and Websites are collectively referred to as Services); and personal </div><div class="t m0 x2 h5 y1b ff2 fs2 fc4 sc0 ls0 ws0">information about you provided by other users of the Service<span class="_ _1"></span>.  For the purpose of this Privacy Policy, S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA is the </div><div class="t m0 x2 h5 y1c ff2 fs2 fc4 sc0 ls0 ws0">controller. </div><div class="t m0 x2 h5 y1d ff2 fs2 fc4 sc0 ls0 ws0">This Privacy Policy applies if you are using Services, or any part of the Services, anywhere over the globe.<span class="fc5"> </span></div><div class="t m0 x2 h5 y1e ff2 fs2 fc4 sc0 ls0 ws0">The current version of this Privacy Policy is accessible at our <span class="_ _1"></span>website: <span class="_ _0"></span><span class="fc6">https://swftea.com/custom/privacy-policy</span> </div><div class="t m0 x2 h5 y1f ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y20 ff1 fs2 fc4 sc0 ls0 ws0">2.b) What Privacy Policy Applies to Other SWFTEA Services? </div><div class="t m0 x2 h5 y21 ff2 fs2 fc4 sc0 ls0 ws0">Users may request additional services from S<span class="_ _1"></span>WFTEA.  Because the needs and choices of each user may vary, we </div><div class="t m0 x2 h5 y22 ff2 fs2 fc4 sc0 ls0 ws0">provide separate privacy policies or addendums to this Privacy Policy<span class="_ _1"></span> for certain Additio<span class="_ _0"></span>nal Services.  The separate </div><div class="t m0 x2 h5 y23 ff2 fs2 fc4 sc0 ls0 ws0">privacy policies and addendums explain the types of infor<span class="_ _1"></span>mation we collect, their purposes of use, and other policies </div><div class="t m0 x2 h5 y24 ff2 fs2 fc4 sc0 ls0 ws0">that may apply to the relevant Additional Services.  <span class="_ _1"></span>W<span class="_ _0"></span>hen you choose to use an Addition<span class="_ _1"></span>al Service, you will be<span class="_ _3"></span> </div><div class="t m0 x2 h5 y25 ff2 fs2 fc4 sc0 ls0 ws0">informed of the applicable privacy policy or addendum, which supplements or modifies this<span class="_ _1"></span> Privacy Policy before you </div><div class="t m0 x2 h5 y26 ff2 fs2 fc4 sc0 ls0 ws0">can access that Additional Service. </div><div class="t m0 x2 h5 y27 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h5 y28 ff2 fs2 fc4 sc0 ls0 ws0">Please note that you can check applicable privacy policies and addendums w<span class="_ _1"></span>ithin the respective Servic<span class="_ _3"></span><span class="ls1">e.</span> </div></div><a class="l" href="https://swftea.com/custom/rivacy-policy"><div class="d m1" style="border-style:none;position:absolute;left:349.360000px;bottom:222.510000px;width:134.040000px;height:19.900000px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y29 w1 h8" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x2 h9 y2a ff2 fs1 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h4 y2b ff1 fs1 fc4 sc0 ls0 ws0">3. Typ<span class="_ _1"></span>es of Personal In<span class="_ _1"></span>formation W<span class="_ _1"></span>e Collect </div><div class="t m0 x2 h5 y2c ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y2d ff1 fs2 fc4 sc0 ls0 ws0">3.a) What Personal Information Does SWFTEA Collect? </div><div class="t m0 x2 h5 y2e ff2 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>hen you cre<span class="_ _1"></span>ate an account and use Services, S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA collects, uses, and transfers the f<span class="_ _1"></span>ollowing types of </div><div class="t m0 x2 h5 y2f ff2 fs2 fc4 sc0 ls0 ws0">information: </div><div class="t m0 x2 h6 y30 ff1 fs2 fc4 sc0 ls2 ws0">i. <span class="ls0">Information Concerning Your A<span class="_ _1"></span>ccount </span></div><div class="t m0 x2 h7 y31 ff3 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>hen you cre<span class="_ _1"></span>ate a SWFTEA account in order to access the Services (i.e, Account), S<span class="_ _1"></span>W<span class="_ _0"></span>FT<span class="_ _1"></span>EA will ask you to </div><div class="t m0 x2 h5 y32 ff2 fs2 fc4 sc0 ls0 ws0">provide your EMail or phone number in future.  This information is necessary because w<span class="_ _1"></span>e may send confirmation link<span class="_ _3"></span> </div><div class="t m0 x2 h5 y33 ff2 fs2 fc4 sc0 ls0 ws0">or any code to your Email, as part of our ongoing efforts to detect and deter un<span class="_ _1"></span>authorized or fraudulent use of or </div><div class="t m0 x2 h5 y34 ff2 fs2 fc4 sc0 ls0 ws0">abuse of Services. We may also use your registered phone <span class="_ _1"></span>number to provide you important information about </div><div class="t m0 x2 h5 y35 ff2 fs2 fc4 sc0 ls0 ws0">Services in future. </div><div class="t m0 x2 h5 y36 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y37 ff2 fs2 fc4 sc0 ls0 ws0">Alternatively, When we are able to use <span class="ff1">Login with FB </span>feature<span class="ff1 ls3">: </span>you m<span class="_ _0"></span>ay choose to create an Account using your </div><div class="t m0 x2 h5 y38 ff2 fs2 fc4 sc0 ls0 ws0">Facebook account when, for ex<span class="_ _1"></span>ample, you do<span class="_ _0"></span> not wish to prov<span class="_ _1"></span>ide your phone number or email.  In such a case, </div><div class="t m0 x2 h5 y39 ff2 fs2 fc4 sc0 ls0 ws0">phone number provision is optional.  Please note th<span class="_ _0"></span>at we do not collect your Facebook pa<span class="_ _1"></span>ssword. It is necessary to </div><div class="t m0 x2 h5 y3a ff2 fs2 fc4 sc0 ls0 ws0">provide one of the information above, in order to create an A<span class="_ _1"></span>ccount and use Services.<span class="_ _0"></span> </div><div class="t m0 x2 h5 y3b ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y3c ff1 fs2 fc4 sc0 ls2 ws0">ii. <span class="ls0">Device Information and Access Logs When You Use O<span class="_ _1"></span>ur Service </span></div><div class="t m0 x2 h5 y3d ff2 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>hen you us<span class="_ _1"></span>e Services, we may obtain and maintain certain electronic identification or log data that is automatically </div><div class="t m0 x2 h5 y3e ff2 fs2 fc4 sc0 ls0 ws0">provided by your device such as: device type, OS type, IP a<span class="_ _1"></span>ddress, browser information including type, device </div><div class="t m0 x2 h5 y3f ff2 fs2 fc4 sc0 ls0 ws0">identifier, cookie data, advertising identifier or mobile applicat<span class="_ _1"></span>i<span class="_ _0"></span>on identifier. </div><div class="t m0 x2 h5 y40 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h5 y41 ff2 fs2 fc4 sc0 ls0 ws0">This information is necessary as part of our ongoing efforts to detect and deter unauthoriz<span class="_ _1"></span>ed or fraudulent use of, or </div><div class="t m0 x2 h5 y42 ff2 fs2 fc4 sc0 ls0 ws0">abuse of, Services, as well as to provide you with customized options, and optimize the Serv<span class="_ _1"></span>ice for your device.  </div><div class="t m0 x2 h5 y43 ff2 fs2 fc4 sc0 ls0 ws0">Also, please note that a third party advertising identifier may be a<span class="_ _1"></span>ssociated with your Account through our internal </div><div class="t m0 x2 h5 y44 ff2 fs2 fc4 sc0 ls0 ws0">identifier. </div><div class="t m0 x2 h5 y45 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y46 ff1 fs2 fc4 sc0 ls0 ws0">3.b) What Other Information Might SWFTEA Collect? </div><div class="t m0 x2 h5 y47 ff2 fs2 fc4 sc0 ls0 ws0">To improve the quality of Services, we provide additional functionalities, inc<span class="_ _1"></span>lud<span class="_ _0"></span>ing the ability to access your Account </div><div class="t m0 x2 h5 y48 ff2 fs2 fc4 sc0 ls0 ws0">from multiple devices, help you find friends via the Service, and to make  Services more ef<span class="_ _1"></span>ficient, usable and </div><div class="t m0 x2 h5 y49 ff2 fs2 fc4 sc0 ls0 ws0">enjoyable.  If you choose to use such functionalities, we may <span class="_ _1"></span>ask you to provide the information below.<span class="_ _0"></span> </div><div class="t m0 x2 h5 y4a ff2 fs2 fc4 sc0 ls4 ws0">Yo<span class="ls0">u m<span class="_ _0"></span>ay choose not to provide the following information. How<span class="_ _1"></span>ever, if you do so, there may be cases where you </span></div><div class="t m0 x2 h5 y4b ff2 fs2 fc4 sc0 ls0 ws0">cannot use some parts of Services. </div><div class="t m0 x2 h5 y4c ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 y4d ff1 fs2 fc4 sc0 ls0 ws0">i. Email Address [Mandatory] </div><div class="t m0 x2 h5 y4e ff2 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>e may use your<span class="_ _1"></span> registered e-mail address to provide you with important information about the operation <span class="_ _1"></span>of </div><div class="t m0 x2 h5 y4f ff2 fs2 fc4 sc0 ls0 ws0">Services. </div><div class="t m0 x2 h5 y50 ff2 fs2 fc4 sc0 ls0 ws0">  </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
    <div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><img class="bi x0 y51 w1 ha" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x2 h6 y52 ff1 fs2 fc4 sc0 ls0 ws0">ii. SWFTEA ID [Mandatory] </div><div class="t m0 x2 h5 y53 ff2 fs2 fc4 sc0 ls0 ws0">In order to make it easier for your friends to find you w<span class="_ _1"></span>ithin the Services,  you may  choose to assign a S<span class="_ _1"></span>WFTE<span class="_ _3"></span><span class="ls5">A </span></div><div class="t m0 x2 h5 y54 ff2 fs2 fc4 sc0 ls0 ws0">identification name (i.e, username) to your Account, and allow<span class="_ _1"></span> your friends to find you through your SWFTEA ID.  </div><div class="t m0 x2 h5 y55 ff2 fs2 fc4 sc0 ls0 ws0">Alternatively, you may choose not to allow other S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA users to contact you using your <span class="_ _1"></span>SWFTEA ID from general </div><div class="t m0 x2 h6 y56 ff2 fs2 fc4 sc0 ls0 ws0">settings by turning off making visible on <span class="ff1">Find Friends</span>.  Please note that your S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA ID is not visible to other </div><div class="t m0 x2 h5 y57 ff2 fs2 fc4 sc0 ls0 ws0">SWFTEA users without your consent, and your S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA ID may be a pseudonym <span class="ff3"></span> it does not have to be your real </div><div class="t m0 x2 h5 y58 ff2 fs2 fc4 sc0 ls0 ws0">name. </div><div class="t m0 x2 h5 y59 ff2 fs2 fc4 sc0 ls0 ws0"> Interestingly, we might be able to add an option to invite users to our APP: If you would like to invite individual friends </div><div class="t m0 x2 h5 y5a ff2 fs2 fc4 sc0 ls0 ws0">or contacts to connect with you using the S<span class="_ _1"></span>W<span class="_ _0"></span>FTEA App, you may send them invitations dir<span class="_ _1"></span>ectly via SMS or e<span class="_ _0"></span>-mail </div><div class="t m0 