>agencies, providers of customer support services, and so on.  <span class="_ _1"></span>We take reasonable steps to ensure that they have </div><div class="t m0 x2 h5 yd4 ff2 fs2 fc4 sc0 ls0 ws0">established appropriate and secure information administration and organizational control systems.  W<span class="_ _0"></span>e impose </div><div class="t m0 x2 h5 yd5 ff2 fs2 fc4 sc0 ls0 ws0">binding contractual obligations on such service providers to comply w<span class="_ _1"></span>ith applicable laws and regulations regarding </div><div class="t m0 x2 h5 yd6 ff2 fs2 fc4 sc0 ls0 ws0">the processing of personal information.  <span class="_ _1"></span>W<span class="_ _0"></span>e also require that they access your personal informatio<span class="_ _0"></span>n only to the extent </div><div class="t m0 x2 h5 y6e ff2 fs2 fc4 sc0 ls0 ws0">necessary to perform tasks in accordance with our instructio<span class="_ _1"></span>ns, and for no other purposes.<span class="_ _0"></span> </div><div class="t m0 x2 h5 yd7 ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 yd8 ff1 fs2 fc4 sc0 ls0 ws0">4.f) Does SWFTEA Give My Information to Third Parties? </div><div class="t m0 x2 h5 yd9 ff2 fs2 fc4 sc0 ls0 ws0">Other than as described in this Privacy Policy and other applicable privacy policies or addendums, SWFTEA will not </div><div class="t m0 x2 h5 yda ff2 fs2 fc4 sc0 ls0 ws0">provide your information to any third parties without your con<span class="_ _1"></span>sent, unless we believe in good faith that we are </div><div class="t m0 x2 h5 ydb ff2 fs2 fc4 sc0 ls0 ws0">required or permitted to do so under applicable laws. </div><div class="t m0 x2 h5 ydc ff2 fs2 fc4 sc0 ls0 ws0">  </div><div class="t m0 x2 h6 ydd ff1 fs2 fc4 sc0 ls0 ws0">4.g) Does SWFTEA Use Cookies or Other Similar Technologies? </div><div class="t m0 x2 h5 yde ff2 fs2 fc4 sc0 ls0 ws0">W<span class="_ _0"></span>e use cookie<span class="_ _1"></span>s and similar local storage technologies. </div><div class